$(document).ready(function() {
    function show_message(message) {
        var x = document.getElementById("snackbar");
        if(message == "Please Wait") {
            $("#snackbar").html(message);
            x.className = "show";
            setTimeout(function() {
                x.className = x.className.replace("show", "")
            },10000000)
        }
        else {
            $("#snackbar").html(message);
            x.className = "show";
            setTimeout(function() {
                x.className = x.className.replace("show", "")
            }, 3000)            
        }
    }
    function validateEmail(email) {
        var re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
        return re.test(String(email).toLowerCase())
    }
    $('.send_message_contact').on('click', function() {
        var your_name = $("#name").val();
        var email = $("#email").val();
        var message = $("#message").val();
        if (your_name == "") {
            show_message("Enter your name")
        } else if (email == "") {
            show_message("Enter your email")
        } else if (!validateEmail(email)) {
            show_message("Invalid Email")
        } else if (message == "") {
            show_message("Enter your message")
        } else {
            show_message("Please Wait");
            $(".send_message_contact i").removeClass("hide");
            $(".send_message_contact").addClass('disabled');
            $.post(APP_URL + "/contact_details", {
                name: your_name,
                email: email,
                message: message
            }, function(data, status) {
                show_message("Message sent! Our team will contact you shortly.");
                $(".send_message_contact i").addClass("hide");
                $(".send_message_contact").removeClass('disabled');
                $("#name").val("");
                $("#email").val("");
                $("#message").val("");
            })
        }
    })
/*msme*/
    $('.send_message').on('click', function ()
    {
         var name = $("#name").val();
         var company = $("#company").val();
         var contact = $("#contact").val();
        var email = $("#email").val();
        
        if (name == "") {
            show_message("Enter your name")
        } else if (email == "") {
            show_message("Enter your email")
        } else if (!validateEmail(email)) {
            show_message("Invalid Email")
        } else if (company == "") {
            show_message("Enter your message")
        }else if (contact == "") {
            show_message("Enter your message")
        } 
        else {
            show_message("Please Wait");
            $(".send_message i").removeClass("hide");
            $(".send_message").addClass('disabled');
            $.post(APP_URL + "/msme_data", {
                name: name,
                email: email,
                company: company,
                contact: contact,
            }, function(data, status) {
                show_message("Message sent! Our team will contact you shortly.");
                $(".send_message i").addClass("hide");
                $(".send_message").removeClass('disabled');
                $("#name").val("");
                $("#email").val("");
                    $("#company").val("");
                    $("#contact").val("");
            })
        }
    })


    $('#subscribe_btn').on('click', function() {
        var email = $("#subscribe_email").val();
        if (email == "") {
            $(".error_sub").html('Required');
            $(".error_sub").removeClass('hide')
        } else if (!validateEmail(email)) {
            $(".error_sub").html('Invalid Email');
            $(".error_sub").removeClass('hide')
        } else {
            $(".error_sub").addClass('hide');
            $.post(APP_URL + "/subscribe", {
                email: email,
            }, function(data, status) {
                $("#subscribe_email").val("");
                $(".subs_close").trigger("click")
            })
        }
    })
    $('#navbarSideButton').on('click', function() {
        if($('.modal-fixed').hasClass('d-none'))
        {
            $('#navbarSide').addClass('reveal')
            $('.modal-fixed').removeClass('d-none');
            $('#navbarSideButton .fa-bars').addClass('d-none');
            $('#navbarSideButton .fa-close').removeClass('d-none');
        }
        else
        {
            $('#navbarSide').removeClass('reveal')
            $('.modal-fixed').addClass('d-none');
            $('#navbarSideButton .fa-bars').removeClass('d-none');
            $('#navbarSideButton .fa-close').addClass('d-none');
        }
    });
    $('.modal-fixed').on('click', function() {
        $('#navbarSide').removeClass('reveal')
        $('.modal-fixed').addClass('d-none');
    });
    if (document.getElementById('map')) {
        setTimeout(function() {
            initMap()
        }, 1000)
    }
})
